import React from 'react';
import logo from './logo.svg';
import './App.css';
import PortfolioProject from './components/PortfolioProject';
import { Grid, List } from '@material-ui/core';
import Axios from 'axios';
import { useState, useEffect } from 'react'


const App: React.FC = props => {

  const [repos, setRepos] = useState([{}])

  Axios.get("https://api.github.com/users/CPlusPlusCompiler/repos")
    .then(response => response.data)
    .then(data => data.map((mapped: React.SetStateAction<{}[]>) => setRepos(mapped)))
    .catch(error => console.error(error))

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          {repos}
        </p>
      </header>

      <body>
        <Grid container justify='center'>
          <List>
            <PortfolioProject
              name="Video ThumbnailDL"
              description="A simple application that downloads Youtube video thumbnails"
              link="logo512.png" />

            <PortfolioProject
              name="Video ThumbnailDL"
              description="A simple applicati"
              link="logo512.png" />
          </List>
        </Grid>
      </body>
    </div>
  );
}

export default App;
